PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "osvv_requests" ("id" integer primary key autoincrement not null, "contact_name" varchar not null, "contact_phone" varchar not null, "contact_email" varchar, "animal_type" varchar check ("animal_type" in ('cat', 'dog', 'other')) not null default 'cat', "animal_type_other" varchar, "animal_gender" varchar check ("animal_gender" in ('male', 'female', 'unknown')) not null default 'unknown', "animal_age" varchar, "animal_description" text, "location_address" text not null, "location_landmark" varchar, "status" varchar check ("status" in ('new', 'processing', 'capture_scheduled', 'captured', 'in_shelter', 'sterilized', 'vaccinated', 'ready_for_return', 'returned', 'completed', 'cancelled')) not null default 'new', "notes" text, "user_id" integer, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, "animals_count" integer not null default '1', "district" varchar, "has_bite" tinyint(1) not null default '0', "is_pregnant" tinyint(1) not null default '0', "departure_date" date, "deadline_date" date, "capture_result" text, "latitude" numeric, "longitude" numeric, "departures_count" integer not null default '0', "next_departure_date" datetime, "max_departures" integer, "departure_notes" text, "requires_video" tinyint(1) not null default '0', "case_description" text, "source_district" varchar, "aurora_number" varchar, "source_type" varchar check ("source_type" in ('district_office', 'telegram', 'vkontakte', 'phone', 'media', 'other')), "bite_medical_files" text, "bite_evidence_files" text, "animal_photos" text, "has_tags" tinyint(1) not null default '0', "tags_description" text, "locations" text, "departure_videos" text, foreign key("user_id") references "users"("id"));
CREATE TABLE IF NOT EXISTS "osvv_comments" ("id" integer primary key autoincrement not null, "osvv_request_id" integer not null, "user_id" integer not null, "comment" text not null, "created_at" datetime, "updated_at" datetime, foreign key("osvv_request_id") references "osvv_requests"("id") on delete cascade, foreign key("user_id") references "users"("id"));
CREATE TABLE IF NOT EXISTS "capture_acts" ("id" integer primary key autoincrement not null, "osvv_request_id" integer not null, "user_id" integer, "act_number" varchar not null, "capture_date" date not null, "capture_time" time, "capture_location" varchar not null, "animal_type" varchar, "animal_gender" varchar, "animal_breed" varchar, "animal_color" varchar, "animal_size" varchar, "animal_features" text, "animal_behavior" varchar, "capturing_method" varchar, "notes" text, "status" varchar not null default 'created', "created_at" datetime, "updated_at" datetime, "animals_count" integer not null default '1', foreign key("osvv_request_id") references "osvv_requests"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "osvv_analytics" ("id" integer primary key autoincrement not null, "request_id" integer not null, "event_type" varchar not null, "event_data" text not null, "event_time" datetime not null, "user_id" varchar, "latitude" numeric, "longitude" numeric, "duration_minutes" integer, "notes" text, "created_at" datetime, "updated_at" datetime, foreign key("request_id") references "osvv_requests"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "roles" ("id" integer primary key autoincrement not null, "name" varchar not null, "display_name" varchar not null, "description" text, "permissions" text, "is_active" tinyint(1) not null default '1', "priority" integer not null default '0', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "user_roles" ("id" integer primary key autoincrement not null, "user_id" integer not null, "role_id" integer not null, "assigned_at" datetime not null default CURRENT_TIMESTAMP, "assigned_by" integer, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade, foreign key("role_id") references "roles"("id") on delete cascade, foreign key("assigned_by") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime, "phone" varchar, "position" varchar, "bio" text, "is_active" tinyint(1) not null default '1', "last_login_at" datetime, "created_by" integer, foreign key("created_by") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "employees" ("id" integer primary key autoincrement not null, "user_id" integer, "employee_number" varchar not null, "first_name" varchar not null, "last_name" varchar not null, "middle_name" varchar, "position" varchar not null, "department" varchar not null, "supervisor_id" integer, "hire_date" date not null, "termination_date" date, "employment_type" varchar not null default 'full_time', "salary" numeric, "phone" varchar, "email" varchar, "address" text, "birth_date" date, "passport_series" varchar, "passport_number" varchar, "inn" varchar, "snils" varchar, "notes" text, "is_active" tinyint(1) not null default '1', "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete set null, foreign key("supervisor_id") references "employees"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "work_schedules" ("id" integer primary key autoincrement not null, "employee_id" integer not null, "name" varchar not null, "type" varchar not null default 'standard', "start_date" date not null, "end_date" date, "monday_start" time, "monday_end" time, "tuesday_start" time, "tuesday_end" time, "wednesday_start" time, "wednesday_end" time, "thursday_start" time, "thursday_end" time, "friday_start" time, "friday_end" time, "saturday_start" time, "saturday_end" time, "sunday_start" time, "sunday_end" time, "lunch_start" time, "lunch_end" time, "hours_per_week" integer not null default '40', "hours_per_day" integer not null default '8', "special_dates" text, "notes" text, "is_active" tinyint(1) not null default '1', "created_at" datetime, "updated_at" datetime, foreign key("employee_id") references "employees"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "time_tracking" ("id" integer primary key autoincrement not null, "employee_id" integer not null, "work_date" date not null, "clock_in" time, "clock_out" time, "lunch_start" time, "lunch_end" time, "total_minutes" integer not null default '0', "work_minutes" integer not null default '0', "lunch_minutes" integer not null default '0', "overtime_minutes" integer not null default '0', "late_minutes" integer not null default '0', "early_leave_minutes" integer not null default '0', "status" varchar not null default 'present', "absence_reason" varchar, "notes" text, "breaks" text, "is_approved" tinyint(1) not null default '0', "approved_by" integer, "approved_at" datetime, "clock_in_lat" numeric, "clock_in_lng" numeric, "clock_out_lat" numeric, "clock_out_lng" numeric, "created_at" datetime, "updated_at" datetime, foreign key("employee_id") references "employees"("id") on delete cascade, foreign key("approved_by") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "animal_stages" ("id" integer primary key autoincrement not null, "name" varchar not null, "slug" varchar not null, "description" text, "color" varchar not null default '#6B7280', "order" integer not null default '0', "duration_days" integer, "is_final" tinyint(1) not null default '0', "is_active" tinyint(1) not null default '1', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "stage_tasks" ("id" integer primary key autoincrement not null, "stage_id" integer not null, "name" varchar not null, "description" text, "order" integer not null default '0', "is_required" tinyint(1) not null default '1', "is_active" tinyint(1) not null default '1', "metadata" text, "created_at" datetime, "updated_at" datetime, foreign key("stage_id") references "animal_stages"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "animal_task_completions" ("id" integer primary key autoincrement not null, "animal_id" integer not null, "task_id" integer not null, "completed_by" integer not null, "completed_at" datetime not null, "notes" text, "data" text, "created_at" datetime, "updated_at" datetime, foreign key("animal_id") references "animals"("id") on delete cascade, foreign key("task_id") references "stage_tasks"("id") on delete cascade, foreign key("completed_by") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "animals" ("id" integer primary key autoincrement not null, "name" varchar, "type" varchar not null, "gender" varchar not null default ('unknown'), "breed" varchar, "color" varchar, "age_months" integer, "weight" numeric, "description" text, "photo" varchar, "chip_number" varchar, "tag_number" varchar, "osvv_request_id" integer, "current_stage_id" integer, "arrived_at" datetime not null, "stage_started_at" datetime not null, "completed_at" datetime, "status" varchar not null default ('active'), "created_at" datetime, "updated_at" datetime, "cage_number" varchar, foreign key("osvv_request_id") references osvv_requests("id") on delete set null on update no action, foreign key("current_stage_id") references "animal_stages"("id"));
CREATE TABLE IF NOT EXISTS "departure_route_requests" ("id" integer primary key autoincrement not null, "departure_route_id" integer not null, "osvv_request_id" integer not null, "sequence_order" integer not null default '1', "estimated_time" integer not null default '60', "notes" text, "created_at" datetime, "updated_at" datetime, "execution_status" varchar check ("execution_status" in ('pending', 'visited', 'completed', 'failed', 'cancelled', 'no_animals_found')) not null default 'pending', "execution_result" varchar check ("execution_result" in ('success', 'partial_success', 'no_result', 'failed', 'cancelled')), "execution_notes" text, "executed_at" datetime, "animals_captured" integer not null default '0', "execution_photos" text, foreign key("departure_route_id") references "departure_routes"("id") on delete cascade, foreign key("osvv_request_id") references "osvv_requests"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "departure_routes" ("id" integer primary key autoincrement not null, "departure_plan_id" integer not null, "name" varchar not null, "assigned_user_id" integer, "start_time" time, "priority" integer not null default ('1'), "notes" text, "requests_count" integer not null default ('0'), "estimated_duration" integer not null default ('0'), "status" varchar not null default ('pending'), "created_at" datetime, "updated_at" datetime, "driver_user_id" integer, "planned_date" date, "actual_start_time" datetime, "actual_end_time" datetime, "completion_status" varchar check ("completion_status" in ('not_started', 'in_progress', 'completed', 'partially_completed', 'failed', 'cancelled')) not null default 'not_started', "completion_notes" text, "completion_percentage" integer not null default '0', foreign key("assigned_user_id") references users("id") on delete no action on update no action, foreign key("departure_plan_id") references departure_plans("id") on delete cascade on update no action, foreign key("driver_user_id") references "users"("id"));
CREATE TABLE IF NOT EXISTS "departure_route_animals" ("id" integer primary key autoincrement not null, "departure_route_id" integer not null, "animal_id" integer not null, "sequence_order" integer not null default '1', "estimated_time" integer not null default '30', "notes" text, "created_at" datetime, "updated_at" datetime, "release_status" varchar check ("release_status" in ('pending', 'released', 'failed', 'cancelled')) not null default 'pending', "release_result" varchar check ("release_result" in ('success', 'failed', 'cancelled')), "release_notes" text, "released_at" datetime, "release_location" varchar, foreign key("departure_route_id") references "departure_routes"("id") on delete cascade, foreign key("animal_id") references "animals"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "departure_plans" ("id" integer primary key autoincrement not null, "name" varchar not null, "planned_date" date not null, "status" varchar not null default ('draft'), "created_by" integer, "notes" text, "total_requests" integer not null default ('0'), "total_routes" integer not null default ('0'), "estimated_duration" integer not null default ('0'), "created_at" datetime, "updated_at" datetime, foreign key("created_by") references users("id") on delete no action on update no action);
CREATE TABLE IF NOT EXISTS "employee_tasks" ("id" integer primary key autoincrement not null, "title" varchar not null, "description" text, "priority" varchar not null default ('medium'), "status" varchar not null default ('pending'), "type" varchar not null default ('general'), "assigned_to" integer not null, "created_by" integer not null, "assigned_by" integer, "due_date" datetime, "started_at" datetime, "completed_at" datetime, "estimated_hours" integer, "actual_hours" integer, "notes" text, "completion_notes" text, "attachments" text, "tags" text, "osvv_request_id" integer, "animal_id" integer, "employee_id" integer, "created_at" datetime, "updated_at" datetime, "departure_plan_id" integer, foreign key("employee_id") references employees("id") on delete set null on update no action, foreign key("animal_id") references animals("id") on delete set null on update no action, foreign key("osvv_request_id") references osvv_requests("id") on delete set null on update no action, foreign key("assigned_by") references users("id") on delete set null on update no action, foreign key("created_by") references users("id") on delete cascade on update no action, foreign key("assigned_to") references users("id") on delete cascade on update no action, foreign key("departure_plan_id") references "departure_plans"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "animal_transfer_acts" ("id" integer primary key autoincrement not null, "act_number" varchar not null, "act_date" date not null, "transfer_type" varchar check ("transfer_type" in ('intake', 'release', 'return')) not null, "from_organization" varchar not null, "to_organization" varchar not null, "from_representatives" text not null, "to_representatives" text not null, "transfer_reason" text, "notes" text, "status" varchar check ("status" in ('draft', 'signed', 'completed')) not null default 'draft', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "animal_transfer_act_animals" ("id" integer primary key autoincrement not null, "transfer_act_id" integer not null, "animal_id" integer not null, "animal_condition" text, "special_notes" text, "created_at" datetime, "updated_at" datetime, foreign key("transfer_act_id") references "animal_transfer_acts"("id") on delete cascade, foreign key("animal_id") references "animals"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "animal_inspection_commissions" ("id" integer primary key autoincrement not null, "commission_name" varchar not null, "formation_date" date not null, "valid_until" date, "members" text not null, "is_active" tinyint(1) not null default '1', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "animal_inspection_acts" ("id" integer primary key autoincrement not null, "act_number" varchar not null, "inspection_date" date not null, "commission_id" integer not null, "animal_id" integer not null, "health_status" varchar check ("health_status" in ('healthy', 'sick', 'injured', 'critical')) not null, "aggression_level" varchar check ("aggression_level" in ('none', 'low', 'moderate', 'high', 'unmotivated')) not null, "sterilization_required" tinyint(1) not null default '0', "is_sterilized" tinyint(1) not null default '0', "sterilization_date" date, "sterilization_mark" varchar, "return_to_habitat_allowed" tinyint(1) not null default '0', "return_conditions" text, "inspection_notes" text, "commission_signatures" text not null, "status" varchar check ("status" in ('draft', 'signed', 'completed')) not null default 'draft', "created_at" datetime, "updated_at" datetime, foreign key("commission_id") references "animal_inspection_commissions"("id"), foreign key("animal_id") references "animals"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "animal_return_procedures" ("id" integer primary key autoincrement not null, "animal_id" integer not null, "inspection_act_id" integer not null, "original_location" varchar not null, "location_coordinates" text, "planned_return_date" date not null, "actual_return_date" date, "return_status" varchar check ("return_status" in ('planned', 'approved', 'in_progress', 'completed', 'cancelled')) not null default 'planned', "return_conditions_met" text, "return_notes" text, "responsible_persons" text not null, "created_at" datetime, "updated_at" datetime, foreign key("animal_id") references "animals"("id") on delete cascade, foreign key("inspection_act_id") references "animal_inspection_acts"("id"));
CREATE TABLE IF NOT EXISTS "regulatory_documents" ("id" integer primary key autoincrement not null, "document_type" varchar not null, "document_number" varchar not null, "document_date" date not null, "issuing_authority" varchar not null, "title" varchar not null, "description" text, "file_path" varchar, "is_active" tinyint(1) not null default '1', "effective_from" date not null, "effective_until" date, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "menu_items" ("id" integer primary key autoincrement not null, "title" varchar not null, "route" varchar, "icon" varchar not null, "order" integer not null default '0', "is_active" tinyint(1) not null default '1', "is_submenu" tinyint(1) not null default '0', "parent_id" integer, "submenu_id" varchar, "created_at" datetime, "updated_at" datetime, foreign key("parent_id") references "menu_items"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "animal_cage_movements" ("id" integer primary key autoincrement not null, "animal_id" integer not null, "from_cage" varchar, "to_cage" varchar, "comment" text, "moved_at" datetime, "moved_by" integer, "created_at" datetime, "updated_at" datetime, foreign key("animal_id") references "animals"("id") on delete cascade, foreign key("moved_by") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "cage_blocks" ("id" integer primary key autoincrement not null, "title" varchar, "rows" integer not null default '1', "cols" integer not null default '1', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "cages" ("id" integer primary key autoincrement not null, "number" varchar not null, "title" varchar, "capacity" integer not null default ('2'), "layout" text, "created_at" datetime, "updated_at" datetime, "cage_block_id" integer, "row_index" integer, "col_index" integer, foreign key("cage_block_id") references "cage_blocks"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "animal_registration_cards" ("id" integer primary key autoincrement not null, "animal_id" integer not null, "registration_number" varchar not null, "registration_date" date not null, "intake_source" varchar, "intake_location" text, "physical_description" text, "special_marks" text, "reproductive_status" varchar, "veterinary_notes" text, "vaccination_history" text, "card_status" varchar, "created_at" datetime, "updated_at" datetime, "category" varchar, "coat" varchar, "ears" varchar, "tail" varchar, "size" varchar, "clinical_exam_date" date, "clinical_exam_conclusion" text, "aggression_notes" text, "behavior_correction_notes" text, "deworming_date" date, "sterilization_date" date, "sterilization_vet" varchar, "marking_date" date, "tag_number_card" varchar, "chip_number_card" varchar, "vet_doc_number" varchar, "vet_doc_date" date, "capture_act_number" varchar, "capture_act_date" date, "aggression_act_number" varchar, "aggression_act_date" date, "outcome_reason" text, "outcome_date" date, "release_address" text, "new_owner_type" varchar, "new_owner_name" varchar, "new_owner_address" text, "new_owner_phone" varchar, "photo_face" varchar, "photo_profile" varchar, "capture_location_address" text, "vaccination_act_number" varchar, "vaccination_act_date" date, "vaccination_type" varchar, "vaccination_series" varchar, "vaccination_manufacture_date" varchar, foreign key("animal_id") references animals("id") on delete cascade on update no action);
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE INDEX "osvv_requests_district_index" on "osvv_requests" ("district");
